    const{name,setName} = useContext
    return(
        <form>
        <input 
        className="login-input"
        placeholder="Digite seu nome"
        />
        <div className="container-btn">
                <Link to="/gamepage">
                    <button className="btn">Ver cartas</button>
                </Link>
            </div>
        </form>
    )
}
export default Home;
